var b="url",c="手续费管理.html",d="generationDate",e=new Date(1765480869416.058),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=1952,l="height",m=0,n="adaptiveViews",o="sketchKeys",p="s0",q="variables",r="OnLoadVariable",s="page",t="packageId",u="dd66caef681d4b0499158d6677c3da3f",v="type",w="Axure:Page",x="手续费管理",y="notes",z="annotations",A="fn",B="1",C="ownerId",D="45cd728a50e045f98fcebc618627399d",E="label",F="注释",G="<p><span>1</span><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;\">、如果是订单信息，则记录订单号，订单结果：盈利，亏损和平局；</span></p><p><span>2</span><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;\">、如果是手动调整余额或者增加彩金，则记录调整原因。</span></p><p><span>3</span><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;\">、如果是系统自动赠送福利，存款赠送和余额返利：</span></p><ul><li style=\"\"><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;\">充值赠送，显示充值赠送</span><span>+</span><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;\">赠送比例；</span></li><li style=\"\"><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;\">余额返利，显示余额返利</span></li></ul>",H="2",I="67b6733a534b42fa82ce1aea8188b1f7",J="<p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;\">帐变类型：</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">秒合约下单：指的是秒合约申请下单</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">秒合约结算：指的是秒合约已经结算</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">秒合约手续费：指的是秒合约下单的手续费</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">期权合约下单：指的是期权合约下单</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">期权合约结算：指的是期权合约结算</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">调整：指的是用户调整可用余额</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">充值：指的是用户充值记录</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">提现申请：指的是用户提现申请的记录</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">提现成功：指的是用户提现成功的记录</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">提现手续费：指的是用户提现成功的手续费记录</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">存款赠送：指的是存款成功赠送金额</span></p><p><span style=\"font-family:&quot;PingFangSC-Regular&quot;, &quot;PingFang SC&quot;, sans-serif;color:#4B4B4B;\">彩金：指的是用户调整账户的余额类型</span></p>",K="style",L="baseStyle",M="627587b6038d43cca051c114ac41ad32",N="pageAlignment",O="center",P="fill",Q="fillType",R="solid",S="color",T=0xFFFFFFFF,U="image",V="imageAlignment",W="horizontal",X="near",Y="vertical",Z="imageRepeat",ba="auto",bb="favicon",bc="sketchFactor",bd="0",be="colorStyle",bf="appliedColor",bg="fontName",bh="Applied Font",bi="borderWidth",bj="borderVisibility",bk="all",bl="borderFill",bm=0xFF797979,bn="cornerRadius",bo="cornerVisibility",bp="outerShadow",bq="on",br=false,bs="offsetX",bt=5,bu="offsetY",bv="blurRadius",bw="spread",bx="r",by=0,bz="g",bA="b",bB="a",bC=0.34901960784313724,bD="adaptiveStyles",bE="interactionMap",bF="diagram",bG="objects",bH="id",bI="6f967c88c5164c359739f4dc442030bb",bJ="friendlyType",bK="底板",bL="referenceDiagramObject",bM="styleType",bN="visible",bO=true,bP="\"ArialMT\", \"Arial\", sans-serif",bQ